"use strict";(self.webpackChunklogbook=self.webpackChunklogbook||[]).push([[297],{9011:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"/2022/04/18/brutal-attack","metadata":{"permalink":"/chess-blog/2022/04/18/brutal-attack","source":"@site/chess-blog/2022-04-18-brutal-attack.md","title":"Brutal Attack","description":"During this game, I was able to line all my pieces up and stomp the opponent\'s king with a back rank checkmate.","date":"2022-04-18T00:00:00.000Z","formattedDate":"April 18, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"stomp","permalink":"/chess-blog/tags/stomp"},{"label":"back","permalink":"/chess-blog/tags/back"},{"label":"rank","permalink":"/chess-blog/tags/rank"},{"label":"600","permalink":"/chess-blog/tags/600"}],"readingTime":0.225,"truncated":false,"authors":[{"name":"Robert Colley","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"nextItem":{"title":"Take My Time","permalink":"/chess-blog/2022/04/16/take-my-time"}},"content":"![solid game](/img/chess/2022-04-18-brutal-attack.gif)\\n\\n[Chess.com Analysis Board](https://www.chess.com/analysis/game/live/44028852969?tab=analysis)\\n\\nI thought I had blundered the game away when I lost my bishop without thinking. I ended up being able to stack my rooks and my queen and forcing an attack that my opponent couldn\'t defend, and my opponent resigned."},{"id":"/2022/04/16/take-my-time","metadata":{"permalink":"/chess-blog/2022/04/16/take-my-time","source":"@site/chess-blog/2022-04-16-take-my-time.md","title":"Take My Time","description":"Took my time and won!","date":"2022-04-16T00:00:00.000Z","formattedDate":"April 16, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"time","permalink":"/chess-blog/tags/time"},{"label":"clock","permalink":"/chess-blog/tags/clock"},{"label":"600","permalink":"/chess-blog/tags/600"}],"readingTime":0.285,"truncated":false,"authors":[{"name":"Robert Colley","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"Brutal Attack","permalink":"/chess-blog/2022/04/18/brutal-attack"},"nextItem":{"title":"Chasing the King","permalink":"/chess-blog/2022/03/31/chasing-king"}},"content":"![solid game](/img/chess/2022-04-16-take-my-time.gif)\\n\\n[Chess.com Analysis Board](https://www.chess.com/analysis/game/live/43850158209?tab=analysis)\\n\\nTook my time, and really rocked this guy with a quality checkmate. I really liked how my light-squared bishop covered everything for a while, allowing me to move my knight into attack and open up my queen for the final checkmate. I finished the game with about 1 minute on the clock."},{"id":"/2022/03/31/chasing-king","metadata":{"permalink":"/chess-blog/2022/03/31/chasing-king","source":"@site/chess-blog/2022-03-31-chasing-king.md","title":"Chasing the King","description":"Chased the king around the board and ended up walking him into a MATE!","date":"2022-03-31T00:00:00.000Z","formattedDate":"March 31, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"chasing","permalink":"/chess-blog/tags/chasing"},{"label":"king","permalink":"/chess-blog/tags/king"},{"label":"queen","permalink":"/chess-blog/tags/queen"},{"label":"500","permalink":"/chess-blog/tags/500"}],"readingTime":0.14,"truncated":false,"authors":[{"name":"Robert Colley","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"Take My Time","permalink":"/chess-blog/2022/04/16/take-my-time"},"nextItem":{"title":"I Got Murdered","permalink":"/chess-blog/2022/03/31/i-got-murdered"}},"content":"In this game, I kept my cool as the opponent was trying to infiltrate with his queen. I ended up chasing his king around and winning!\\n\\n![solid game](/img/chess/2022-03-31-chasing-king.gif)"},{"id":"/2022/03/31/i-got-murdered","metadata":{"permalink":"/chess-blog/2022/03/31/i-got-murdered","source":"@site/chess-blog/2022-03-31-i-got-murdered.md","title":"I Got Murdered","description":"Brutal loss I suffered, and what I learned from it","date":"2022-03-31T00:00:00.000Z","formattedDate":"March 31, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"ouch","permalink":"/chess-blog/tags/ouch"},{"label":"murdered","permalink":"/chess-blog/tags/murdered"},{"label":"500","permalink":"/chess-blog/tags/500"}],"readingTime":0.24,"truncated":false,"authors":[{"name":"Robert Colley","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"Chasing the King","permalink":"/chess-blog/2022/03/31/chasing-king"},"nextItem":{"title":"Playing Solid Chess 2","permalink":"/chess-blog/2022/03/31/solid-game-2"}},"content":"This was a tough game. I got murdered by my opponent. This is called the [Wayward Queen Attack](https://chesspathways.com/chess-openings/kings-pawn-opening/wayward-queen-attack/), and to defend it I had to play Nc6 then g6. This forces the queen back, and then if the queen goes back to e3, I play Nf6.\\n\\n![solid game](/img/chess/2022-03-31-i-got-murdered.gif)"},{"id":"/2022/03/31/solid-game-2","metadata":{"permalink":"/chess-blog/2022/03/31/solid-game-2","source":"@site/chess-blog/2022-03-31-solid-game-2.md","title":"Playing Solid Chess 2","description":"Solid chess game AGAIN","date":"2022-03-31T00:00:00.000Z","formattedDate":"March 31, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"solid","permalink":"/chess-blog/tags/solid"},{"label":"500","permalink":"/chess-blog/tags/500"}],"readingTime":0.08,"truncated":false,"authors":[{"name":"Robert Colley","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"I Got Murdered","permalink":"/chess-blog/2022/03/31/i-got-murdered"},"nextItem":{"title":"Playing Solid Chess","permalink":"/chess-blog/2022/03/31/solid-game"}},"content":"Another incredibly solid game. Did hang a few pawns, but completely destroyed my opponent.\\n\\n![solid game](/img/chess/2022-03-31-solid-game-2.gif)"},{"id":"/2022/03/31/solid-game","metadata":{"permalink":"/chess-blog/2022/03/31/solid-game","source":"@site/chess-blog/2022-03-31-solid-game.md","title":"Playing Solid Chess","description":"Solid chess game","date":"2022-03-31T00:00:00.000Z","formattedDate":"March 31, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"solid","permalink":"/chess-blog/tags/solid"},{"label":"500","permalink":"/chess-blog/tags/500"}],"readingTime":0.2,"truncated":false,"authors":[{"name":"Robert Colley","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"Playing Solid Chess 2","permalink":"/chess-blog/2022/03/31/solid-game-2"},"nextItem":{"title":"Stomping","permalink":"/chess-blog/2022/03/28/stomping"}},"content":"I\'m proud of the fact that I played a really solid game. I kept waiting and waiting, and then my opponent moved a bishop protecting the queen and promptly blundered the queen. After taking his queen, he resigned!\\n\\n![solid game](/img/chess/2022-03-31-solid-game.gif)"},{"id":"/2022/03/28/stomping","metadata":{"permalink":"/chess-blog/2022/03/28/stomping","source":"@site/chess-blog/2022-03-28-stomping.md","title":"Stomping","description":"I really liked the checkmate I had on this guy.","date":"2022-03-28T00:00:00.000Z","formattedDate":"March 28, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"gobble","permalink":"/chess-blog/tags/gobble"},{"label":"500","permalink":"/chess-blog/tags/500"}],"readingTime":0.01,"truncated":false,"authors":[{"name":"Robert Colley","title":"Checkmate Master","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"Playing Solid Chess","permalink":"/chess-blog/2022/03/31/solid-game"},"nextItem":{"title":"10 Minute vs. measmyself","permalink":"/chess-blog/2022/03/25/vs-measmyself"}},"content":"![absolute stomping](/img/chess/2022-03-28-stomping.gif)"},{"id":"/2022/03/25/vs-measmyself","metadata":{"permalink":"/chess-blog/2022/03/25/vs-measmyself","source":"@site/chess-blog/2022-03-25-vs-measmyself.md","title":"10 Minute vs. measmyself","description":"Great game I played where I gobbled up all of his pieces","date":"2022-03-25T00:00:00.000Z","formattedDate":"March 25, 2022","tags":[{"label":"chess","permalink":"/chess-blog/tags/chess"},{"label":"gobble","permalink":"/chess-blog/tags/gobble"},{"label":"500","permalink":"/chess-blog/tags/500"}],"readingTime":0.365,"truncated":false,"authors":[{"name":"Robert Colley","title":"Chess Piece Gobbler","url":"https://github.com/robertjcolley","image_url":"https://github.com/robertjcolley.png","imageURL":"https://github.com/robertjcolley.png"}],"prevItem":{"title":"Stomping","permalink":"/chess-blog/2022/03/28/stomping"}},"content":"Here is a great game I played recently at around 500! I\'m white, opponent is black.\\n\\nI am proud of the move 26 Bishop E5. This moved allowed me to check the Black King, and collect a rook. This move had a discovered check, which then allowed me to take the other rook without losing my bishop. After collecting both rooks and threatening the knight on b4, my opponent resigned.\\n\\n![game vs measmyself](/img/chess/2022-03-25-vs-measmyself.gif)"}]}')}}]);